func HandlerJS(writer http.ResponseWriter, request *http.Request) {
	path := request.URL.Path
	static_path := strings.TrimLeft(path, STATIC_JS_URL)
	bytes := Static_JS[static_path]
	if bytes == nil {
		writer.WriteHeader(404)
		return
	}
	writer.Header().Set("Accept-Ranges", "bytes")
	writer.Header().Set("Connection", "keep-alive")
	writer.Header().Set("Content-Type", "text/javascript")
	writer.Header().Set("Server", "localhost")
	writer.Header().Set("Date", time.Now().Format("Mon, 2 Jan 2006 15:04:05 GMT"))

	writer.WriteHeader(200)
	writer.Write(bytes)
}

func HandlerCSS(writer http.ResponseWriter, request *http.Request) {
	writer.Header().Set("Accept-Ranges", "bytes")
	writer.Header().Set("Connection", "keep-alive")
	writer.Header().Set("Content-Type", "text/css")
	writer.Header().Set("Server", "localhost")
	writer.Header().Set("Date", time.Now().Format("Mon, 2 Jan 2006 15:04:05 GMT"))
	writer.WriteHeader(200)
	writer.Write(Index_Css_Arr)
}

func HandIcon(w http.ResponseWriter, r *http.Request) {
	w.Header().Set("Content-Type", "image/x-icon")
	w.Header().Set("Cache-Control", "max-age=604800")
	w.Write(IMG)
}

func HandIndex(w http.ResponseWriter, r *http.Request) {
	auth := r.URL.Query().Get(Key)
	if strings.EqualFold(auth, Auth) {
		// Content-Type: text/html; charset=utf-8
		w.Header().Set("Content-Type", "text/html; charset=utf-8")
		w.WriteHeader(200)
		w.Write(Index_Html_Arr)
		return
	}
	w.WriteHeader(401)
	w.Write(Null_Auth)
	log.Println("请求地址访问权限不足", r.RemoteAddr)
}
